import React from "react";

function Resume() {
  return (
    <div className="page"> {/* <-- ADDED: Class for styling */}
      <h1>Resume</h1>
      <p>Download my resume: <a href="/resume.pdf" target="_blank" rel="noopener noreferrer">Resume PDF</a></p>
    </div>
  );
}

export default Resume;
